import React from 'react';
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import * as IoIcons from 'react-icons/io';

export const Data = [

 {
    title: 'EDITOR',
    path: '/',
    icon: <AiIcons.AiFillHome />,
    cName: 'nav-text'
  },
  {
    title: 'HTML',
    path: '/H1',
    icon: <IoIcons.IoIosPaper />,
    cName: 'nav-text'
  },
  {
    title: 'CSS',
    path: '/C2',
    icon: <IoIcons.IoIosPaper />,
    cName: 'nav-text'
  },
  {
    title: 'JAVA SCRIPT',
    path: '/J3',
    icon: <IoIcons.IoIosPaper />,
    cName: 'nav-text'
  },
];
